import { PageAllTopTitle } from "../../../../../common/ManagerComponents/PageAllTopTitle";
import { BsArrowLeft } from "react-icons/bs";
import { Nav, Tab } from "react-bootstrap";
export const ProjectDetails = () => {
  return (
    <>
      <div className="custom_container">
        <PageAllTopTitle link={-1} icon={<BsArrowLeft />} title="Project" />
        <MyTab />
      </div>
    </>
  );
};
const MyTab = () => {
  return (
    <>
      <div className="project_list_tabs_main_div">
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <div className=" mb-4">
            <Nav variant="pills" className="flex">
              <Nav.Item>
                <Nav.Link eventKey="first">Dashboard</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey="Overview">Overview</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey="Team">Team & Work Progress</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey="Chats">Chats</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey="Meetings">Meetings & Notes</Nav.Link>
              </Nav.Item>
            </Nav>
          </div>

          <Tab.Content>
            <Tab.Pane eventKey="first">1</Tab.Pane>
            <Tab.Pane eventKey="Assigned">2</Tab.Pane>
            <Tab.Pane eventKey="Completed">3</Tab.Pane>
            <Tab.Pane eventKey="Progress">4</Tab.Pane>
            <Tab.Pane eventKey="Hold">5</Tab.Pane>
            <Tab.Pane eventKey="Drafts">6</Tab.Pane>
          </Tab.Content>
        </Tab.Container>
      </div>
    </>
  );
};
